            <BrowserRouter>
            <nav>
<Link to="/Details">Details</Link>
<br></br>
<Link to="/Vitals">Vitals</Link>
<Route
                    path="/Details"
                    component={Details}
                    exact 
                />
                <Route
                    path="/Vitals"
                    component={Vitals} 
                />
                </nav>
            </BrowserRouter>
            </div>
        )
    }
}
